document.addEventListener('DOMContentLoaded', () => {
    const copyButton2 = document.getElementById('bookmarkScript');
    copyButton2.addEventListener('click', () => {
        navigator.clipboard.writeText(injectToolScript.trim())
            .then(() => {
                cuteAlert({
                    type: "success",
                    title: "成功",
                    message: "已拷貝书签的URL地址",
                    buttonText: "是"
                });
            })
            .catch((err) => {
                console.error('Failed to copy message: ', err);
            });
    });

    const copyButton = document.getElementById('mainScript');
    copyButton.addEventListener('click', () => {
        navigator.clipboard.writeText(processScript.trim())
            .then(() => {
                cuteAlert({
                    type: "success",
                    title: "成功",
                    message: "已拷貝插件",
                    buttonText: "是"
                });
            })
            .catch((err) => {
                console.error('Failed to copy message: ', err);
            });
    });
});


